+#!/usr/bin/perl
+use strict;
+use warnings;
+use lib 'Comserv/lib';
+use Comserv::Util::Logging;
+
+# Initialize logging
+Comserv::Util::Logging->init();
+
+# Create a logger instance
+my $logger = Comserv::Util::Logging->instance();
+
+# Test the fixed log_to_file method
+print "Testing log_to_file method...\n";
+
+# This should now work correctly without trying to create a file with the message as filename
+$logger->log_to_file("Found documentation file: Documentation/admin/theme_mappings_handling.tt", undef, 'DEBUG');
+$logger->log_to_file("Found documentation: theme_mappings_handling (type: template, path: Documentation/admin/theme_mappings_handling.tt)", undef, 'DEBUG');
+
+print "Test completed successfully!\n";
+print "Check the log file in logs/application.log to see the messages.\n";

